//npm start
import React from 'react';
import avatar from '../../../../images/avatar.jpg';
import PostCss from './Post.module.css';

const Post = (props) => {
    return (
        <React.Fragment>
                <article className={PostCss.article}>
                    <img src={avatar} alt="Аватар" />
                    <p>props.message</p>
                    <span>Like</span>
                </article>
        </React.Fragment>
    );
}

export default Post;
